(33, NULL, 13, 35, NULL, '[\"22\"]', '[\"34\"]', NULL, 'mazagan-beach-golf-resort', NULL, 1280, '[\"9\",\"8\",\"7\",\"6\"]', 'Km 10, Route de CasablancaØ El Jadida 24000, Maroc', 33.281561, -8.383829, '6024f892640ba_1613035666.jpg', '[\"6024f7be7fade_1613035454.jpg\",\"6024f7c0743c1_1613035456.jpg\",\"6024f85689f32_1613035606.jpg\"]', '[{\"question\":\"Day 1\",\"answer\":\"<p>Description<\\/p>\"}]', 1, NULL, 0, 'HÃ´tel Mazagan Beach & Golf Resort', 'Vivez lâune des plus belles expÃ©riences de votre vie Ã  l\'hÃ´tel Mazagan Beach Golf avec Rentacs Tours. RÃ©servez votre prochain sÃ©jour dÃ¨s maintenant.', '2021-03-04 14:38:51', '2021-02-03 09:34:48'),
(34, NULL, 13, 31, NULL, '[\"22\"]', '[\"36\"]', NULL, 'widiane-suites-spa', NULL, 3055, '[\"9\",\"8\"]', 'Chemin Du Lac 44, R306, Bin El-OuidaneØ Bin el Ouidane 22200, Maroc', 32.10674, -6.448513, '6023e04dd55b5_1612963917.jpg', '[\"6024f58288980_1613034882.jpg\",\"6024f58504521_1613034885.jpg\",\"6024f588a56d1_1613034888.jpg\"]', '[{\"question\":\"Jour 1\",\"answer\":\"<div class=\\\"daily-schedule-body\\\"><div class=\\\"col-md-8 col-sm-8\\\"><p>Vivez un s&eacute;jour exceptionnel &agrave; Widiane Suites &amp; Spa.. Un endroit tout juste magnifique o&ugrave; vous pouvez faire une balade en bateau, une sortie en montagne, ou tout simplement profiter des paysages &agrave; couper le souffle &hellip;<\\/p><p>Il y a tout pour vous faire plaisir et faire plaisir aux enfants. Un cadre magique mais aussi un personnel &agrave; l\'&eacute;coute, des voituriers toujours pr&ecirc;ts &agrave; assurer les liaisons avec le sourire et un service de nettoyage qui prend toutes les mesures d&rsquo;hygi&egrave;ne et toutes les pr&eacute;cautions anti covid.La restauration est sans d&eacute;faut, vous aurez le choix entre 3 entr&eacute;es, plats et desserts&hellip;.<\\/p><p>Une vraie exp&eacute;rience de d&eacute;paysement dans un cadre incroyable aux normes internationales avec vue totale sur le lac Bin El Ouidane&hellip;<\\/p><\\/div><\\/div>\"},{\"question\":\"Jour 2\",\"answer\":\"<div class=\\\"daily-schedule-body\\\"><div class=\\\"col-md-8 col-sm-8\\\"><p>Passez 3 jours en famille de pure d&eacute;tente, dans une chambre spacieuse et moderne avec une vue splendide sur la piscine et le Lac Bin El Ouidane&hellip;Un site vraiment exceptionnel pour vivre 3 jours inoubliables...<\\/p><p>L&rsquo;H&ocirc;tel est &eacute;quip&eacute; de 2 piscines propres constamment entretenues, avec une tr&egrave;s belle vue sur le Lac&hellip; Les repas sont vari&eacute;s et raffin&eacute;s&hellip;<\\/p><p>Le personnel est &agrave; l\'&eacute;coute et les mesures anti-covid sont compl&egrave;tement respect&eacute;es&hellip; Un endroit paradisiaque ou vous pouvez vous d&eacute;connecter du monde ext&eacute;rieur&hellip; Vous n&rsquo;aurez qu&rsquo;une seule envie.. Y retourner!<\\/p><\\/div><\\/div>\"}]', 1, NULL, 0, 'HÃ´tel Widiane Suites & Spa gfs', 'Dans les contreforts tranquilles du Moyen Atlas, se niche l\'hÃ´tel Widiane Suites & Spa, un concentrÃ© d\'essences et de bien-Ãªtre pour vous accueillir et enri....', '2021-05-18 11:44:22', '2021-02-10 13:31:57'),
